import React from "react";
import "./Response.css";

function Result(){
    return (
      <>
      <div className="reCon" >
        <div className="Result">
            <p className="res">Result</p>
            <a className=".r-link" href="">
            <button className="view">
              Home
            </button>
          </a>
        </div>
      </div>
      </>
      
    );
  
  }
  
export default Result;
